import './Footer.css'


const style = {
  backgroundColor: "#F8F8F8",
  borderTop: "1px solid #E7E7E7",
  textAlign: "center",
  padding: "20px",
  position: "fixed",
  left: "0",
  bottom: "0",
  height: "60px",
  width: "100%"
};

const Footer = () => {
  return (
    <div style={style}>
        <div>
            &copy; Copyright | .How Are You?
        </div>
    </div>
  )
}

export default Footer
